import React from 'react';

export default () => (
    <React.Fragment>
        <h1>Hola Mundo</h1>

        <style jsx>{`
            body {
                background: yellow;
            }
        `}</style>
        <style jsx global>{`
            body {
                background: #d3d3d3;
            }
        `}</style>
    </React.Fragment>
)
